import React from 'react';
import logo from './logo.svg';
import './App.css';
import HJETlogo from './HJETlogo.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Login</h3>
        <img src={HJETlogo} />
        <h3>Login</h3>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
